import React from 'react';
import './App.css';
import Footer from './Footer'

function App() {
  return (
    <div className="App">
      <nav>
      <h1>HEllo World!!!</h1>
      <ul>
        <li>Thing 1</li>
        <li>Thing 2</li>
        <li>Thing 3</li>
      </ul>
      </nav>
      <main>
        <p>This is where most of my content goes...</p>
      </main>
      <Footer />
    </div>
  );
}

export default App;
